 canvas.width = imgBitmap.width = 400;
 canvas.height = imgBitmap.height = 400;
imgBitmap.get = function(x, y){
		return this[this.width * y + x];
	},
imgBitmap.set = function(x, y, value){
	this[this.width * y + x] = value;
}

var ctx = canvas.getContext('2d');
var imgData = ctx.getImageData(0,0,imgBitmap.width, imgBitmap.height);
imgBitmap.forEach(function(v,i){
	imgData.data[i*4] = (v^1)*255;
	imgData.data[i*4+1] = (v^1)*255;
	imgData.data[i*4+2] = (v^1)*255;
	imgData.data[i*4+3] = v*255;
})
ctx.putImageData(imgData,0,0)
var patternInfo = new FindPattern(imgBitmap).find();
if(patternInfo){
	ctx.fillStyle = "rgb(200,0,0)";
	ctx.arc(patternInfo.topLeft.x, patternInfo.topLeft.y, 5, 0, Math.PI*2, true);
	ctx.arc(patternInfo.topRight.x, patternInfo.topRight.y, 5, 0, Math.PI*2, true);
	ctx.arc(patternInfo.bottomLeft.x, patternInfo.bottomLeft.y, 5, 0, Math.PI*2, true);
    ctx.fill();
}
var qrMatrix = new Detector(imgBitmap, patternInfo).process();
